  background: #0c0126;
}
/* 地图 */
.ditu {
  width: 47%;
  height: 85%;
  float: left;
  margin-left: 1.5%;
  border: 3px solid #6edcfa;
  box-shadow: 0 0 10px #ffffff;
}
/* 监视 */

/* 头部标签 */
.header {
  height: 8%;
  width: 100%;
  margin-bottom: 10px;
  background-image: url("../../assets/yingzhi/topback.png");
  background-repeat: no-repeat;
  background-size: 100%;
}
.daoy {
  position: relative;
  left: 20px;
  top: 5px;
  z-index: 10000000000;
}
.header_text {
  width: 30%;
  text-align: center;
  color: #fff;
  line-height: 50px;
  font-size: 20px;
  letter-spacing: 10px;
  float: left;
  position: absolute;
  left: 50%;
  top: 0%;
  margin-left: -15%;
}
/* 监控 */
.cctv {
  float: right;
  width: 80%;
  height: 90%;
  margin-right: 0.5%;
}
/* 资源树 */
.ziyuan {
  float: left;
  width: 19%;
  height: 90%;
  border: 1px solid #6edcfa;
}
.shu {
  color: #fff;
  cursor: pointer;
  margin-bottom: 1px;
}
.shu1 {
  padding-left: 20px;
  background: #6edcfa;
  font-size: 20px;
}
.shu2 {
